import Aside from "./components/aside/aside";
import Content from "./components/content/content";
import Header from "./components/header/header";

import "./App.scss";

function App() {
  return (
    <div className="">
      <Aside />
      <div className="wrapper">
        <Header />
        <Content />
      </div>
    </div>
  );
}

export default App;
